import SecondaryLayout from "../../layout/SecondaryLayout";
import {Spacer} from "../../common/layout";
import {FormWrapper, InnerFormSpacer, Title} from "../../common/form_components";
import React from "react";
import SuggestFormInputs from "./Inputs/Inputs";
import SuggestFormControls from "./Controls/Controls";

const SuggestFormWrapper = ({caption = "Безымянный", size = "xl", children, ...props}) => {
    return (
        <>
            <Spacer/>
            <FormWrapper maxWidth={size}>
                <InnerFormSpacer>
                    <Title text={caption}/>
                    {children}
                </InnerFormSpacer>
            </FormWrapper>
        </>
    )
}


const SuggestForm = (props) => {
    return (
        <SecondaryLayout>
            <SuggestFormWrapper caption="Письмо дизайнеру">
                {/*<form noValidate onSubmit={onSubmit}>*/}
                {/*    <SuggestFormInputs*/}
                {/*        inputs={state}*/}
                {/*        handlers={{handleTypeVariant, handleDesc}}*/}
                {/*    />*/}
                {/*    <SuggestFormControls onClear={onClear} onBack={onBack}/>*/}
                {/*</form>*/}
            </SuggestFormWrapper>
        </SecondaryLayout>
    );
}

export default SuggestForm
